
function add_fontStyle(){
  let IkarashiBraille_base64 = "";
  let BNLbrail_base64 = "";

  $('#svg_style').remove();
  let style = document.createElement("style");
  style.type = "text/css";
  style.id = "svg_style";
  style.innerHTML ='@font-face {font-family: "Ikarashi Braille";  src: url("data:application/x-font-ttf;charset=utf-8;base64,' + IkarashiBraille_base64 + '");}'+
                    '@font-face {font-family: "点字線なし";  src: url("data:application/x-font-ttf;charset=utf-8;base64,' + BNLbrail_base64 + '");}'
  $('#svg_draw_area').append(style);
}
